import React from 'react'

const SingleBookCartComponent = (props) => {
    return (
        <div className='card z-dept-0 single-book col s12 m6'>
            <div className='card-content grey-text text-darken-3 teal lighten-5'>
                <span className='card-title '>{props.title}</span>
                <p className='price-single-component left'>Price: {props.price}</p>
                <button className='right'>Remove</button>
            </div>
        </div>
    )
}

export default SingleBookCartComponent
